    false,nt"url": null,nt"notes": "The purpose of this project is to inspect
    electric distribution lines on four United States Fish and Wildlife Service (Service)
    National Wildlife Refuges (NWR) located in Colorado to determine if the lines are
    raptor-friendly. In addition, Service employees will be given training on how to
    identify problem structures and encouraged to participate in powerline surveys.
    The refuges proposed to be surveyed are Two Ponds NWR, Browns Park NWR, Arapaho
    NWR, and Alamosa and Monte Vista NWR. This project will allow the Service to better
    understand the scope of any raptor electrocution problems. Solutions provided will
    give utilities information necessary to effectively address any problems. The result
    will be fewer electrocutions, improved electric service reliability and increased
    compliance with laws protecting Colorado's migratory birds.",nt"owner_org":
